import React from 'react';

import BadgeContainer from './BadgeContainer';
function Badge({ image, heading, text }) {
	return (
		<BadgeContainer>
			<img src={image} alt='' />
			<h2> {heading} </h2>
			<p> {text} </p>
		</BadgeContainer>
	);
}

export default Badge;
